function Header(){
    return(
        <header className="App-header">
            <div className="navbar">
                <h1>Hey There</h1>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Contact</li>
                    <li>Login</li>
                </ul>
            </div>
        </header>
    );
}

export default Header;
